import React from 'react'

const Register = () => {
    return(
        <section classaName='register-section'>
            <h1>Register</h1>
            <form>
                <label for="firstname">First Name:</label>
                <input type='text' id='firstname' name='firstname' className='textfield'/> <br/>
                
                <label for="lastname">Last Name:</label>
                <input type='text' id='lastname' name='lastname' className='textfield'/> <br/>

                 
                <label for="firstname">FirstName:</label>
                <input type='text' id='firstname' name='firstname' className='textfield'/> <br/>


           
            </form>
        </section>
    );
}

export default Register;
